import './App.css';
import { useState } from 'react';
import axios from 'axios';

function App() {
  const [searchText, setSearchText] = useState("");
  const API_KEY = "RGAPI-98cbc205-5ac6-40c3-af2f-0838f6e748ad"

  function searchForPlayer(event) {
    //api call to pull info, refer to routing values in league api doc
    var APICallString = "https://na1.api.riotgames.com/lol/summoner/v4/summoners/by-name/" + searchText + "?api_key=" + API_KEY;
    axios.get(APICallString).then(function(response) {
      console.log(response.data);
    }).catch(function (error) {
    console.log(error);
  });
}
  return (
    <div className="App">
      <div className="container">
        <h5>League of Friends</h5>
        <input type="text" onchange={e=> setSearchText(e.target.value)}></input>
        <button onClick={e=> searchForPlayer(e)}>Search for player</button>
      </div>
    </div>
  );
}

export default App;
